      remainingStudyDay,
      jobApplications,
      overtime,
      sanctions,
      absences,
      lateArrivals,
      entryForm,
      exitForm,
      category,
    } = req.body;

    let message, data;

    const employee = await Employee.findByIdAndUpdate(
      id,
      {
        shift,
        docket,
        name,
        surname,
        position,
        seniority,
        remainingItems,
        remainingLicenses,
        remainingStudyDay,
