import { Server } from "socket.io";
import { updateReportFields } from "./connectionLogics/updateReportLogic";

export const setupSocket = (server) => {
  const io = new Server(server);

  io.on("connection", (socket) => {
    console.log("Nuevo cliente conectado:", socket.id);

    socket.on("updateData", async (data) => {
      const { id, updatedFields } = data;
      const result = await updateReportFields(id, updatedFields);

      if (result.success) {
        // Emitir a todos los clientes conectados
        io.emit("dataUpdated", result.data);
      } else {
        console.error("Error al actualizar los datos:", result.error);
