sourcesContent:
import Entry from "../models/Entry";

export const getEntrys = async (req, res) => {
  try {
    const entrys = await Entry.find();

    res.json(entrys);
  } catch (error) {
    console.error("Error al obtener los reportes:", error);
    res.status(500).json({ error: "Error al obtener los reportes" });
  }
};

