sourcesContent:
import { Schema, model } from "mongoose";

const entrySchema = new Schema(
  {
    name: {
      type: String,
      required: true,
      trim: true,
    },
  },
  {
    versionKey: false,
  }
);

export default model("Entry", entrySchema);

